import React from "react";
import TextField from "@material-ui/core/TextField";

class Main extends React.Component {
  render() {
    return (
      <div className="Text">
        <TextField
          className="TextField"
          label="Enter title"
          variant="outlined"
        />
        <TextField
          className="TextField"
          label="Enter branch"
          variant="outlined"
        />
        <TextField
          className="TextField"
          label="Enter artist"
          variant="outlined"
        />
        <TextField
          className="TextField"
          label="Enter decade"
          variant="outlined"
        />
      </div>
    );
  }
}

export default Main;
